func testUserSubmissionToManyRemoveOpFiles(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a UserSubmission
	var b, c, d, e File

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, userSubmissionDBTypes, false, strmangle.SetComplement(userSubmissionPrimaryKeyColumns, userSubmissionColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*File{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, fileDBTypes, false, strmangle.SetComplement(filePrimaryKeyColumns, fileColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddFiles(ctx, tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.Files().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveFiles(ctx, tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.Files().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if len(b.R.UserSubmissions) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if len(c.R.UserSubmissions) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if d.R.UserSubmissions[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}
	if e.R.UserSubmissions[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}

	if len(a.R.Files) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.Files[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.Files[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

func testUserSubmissionToOneUserUsingSubmitter(t *testing.T) {
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var local UserSubmission
	var foreign User

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, userSubmissionDBTypes, false, userSubmissionColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize UserSubmission struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, userDBTypes, false, userColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize User struct: %s", err)
	}

	if err := foreign.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	local.SubmitterID = foreign.ID
	if err := local.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := local.Submitter().One(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	if check.ID != foreign.ID {
		t.Errorf("want: %v, got %v", foreign.ID, check.ID)
	}

	slice := UserSubmissionSlice{&local}
	if err = local.L.LoadSubmitter(ctx, tx, false, (*[]*UserSubmission)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Submitter == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.Submitter = nil
	if err = local.L.LoadSubmitter(ctx, tx, true, &local, nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Submitter == nil {
		t.Error("struct should have been eager loaded")
	}
}

