func testUserSubmissionToOneSetOpUserUsingSubmitter(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a UserSubmission
	var b, c User

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, userSubmissionDBTypes, false, strmangle.SetComplement(userSubmissionPrimaryKeyColumns, userSubmissionColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &b, userDBTypes, false, strmangle.SetComplement(userPrimaryKeyColumns, userColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &c, userDBTypes, false, strmangle.SetComplement(userPrimaryKeyColumns, userColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	for i, x := range []*User{&b, &c} {
		err = a.SetSubmitter(ctx, tx, i != 0, x)
		if err != nil {
			t.Fatal(err)
		}

		if a.R.Submitter != x {
			t.Error("relationship struct not set to correct value")
		}

		if x.R.SubmitterUserSubmissions[0] != &a {
			t.Error("failed to append to foreign relationship struct")
		}
		if a.SubmitterID != x.ID {
			t.Error("foreign key was wrong value", a.SubmitterID)
		}

		zero := reflect.Zero(reflect.TypeOf(a.SubmitterID))
		reflect.Indirect(reflect.ValueOf(&a.SubmitterID)).Set(zero)

		if err = a.Reload(ctx, tx); err != nil {
			t.Fatal("failed to reload", err)
		}

		if a.SubmitterID != x.ID {
			t.Error("foreign key was wrong value", a.SubmitterID, x.ID)
		}
	}
}
